Problem: find the matrix that corresponds to reflecting over the vector \begin{pmatrix} -1 \\ 3 \end{pmatrix}.


Assistant: To find the matrix that corresponds to reflecting over the vector \begin{pmatrix} -1 \\ 3 \end{pmatrix}, we can use the formula for reflection matrices. The reflection matrix R for reflecting over the vector v is given by:

R = I - 2 * (v * v^T) / (v^T * v)

where I is the identity matrix, v is the vector we are reflecting over, and v^T is the transpose of the vector.

First, let's find the transpose of the vector v:

v = \begin{pmatrix} -1 \\ 3 \end{pmatrix}
v^T = \begin{pmatrix} -1 & 3 \end{pmatrix}

Now, let's calculate the product of v and v^T:

v * v^T = \begin{pmatrix} -1 \\ 3 \end{pmatrix} * \begin{pmatrix} -1 & 3 \end{pmatrix} = \begin{pmatrix} 1 & -3 \\ -3 & 9 \end{pmatrix}

Next, let's calculate the product of v^T and v:

v^T * v = \begin{pmatrix} -1 & 3 \end{pmatrix} * \begin{pmatrix} -1 \\ 3 \end{pmatrix} = 10

Now, we can substitute these values into the formula for the reflection matrix R:

R = I - 2 * (v * v^T) / (v^T * v) = \begin{pmatrix} 1 & 0 \\ 0 & 1 \end{pmatrix} - 2 * \begin{pmatrix} 1 & -3 \\ -3 & 9 \end{pmatrix} / 10

R = \begin{pmatrix} 1 & 0 \\ 0 & 1 \end{pmatrix} - \begin{pmatrix} 2/10 & -6/10 \\ -6/10 & 18/10 \end{pmatrix}

R = \begin{pmatrix} 1 - 2/10 & 0 - (-6/10) \\ 0 - (-6/10) & 1 - 18/10 \end{pmatrix}

R = \begin{pmatrix} 8/10 & 6/10 \\ 6/10 & 2/10 \end{pmatrix}

So, the matrix that corresponds to reflecting over the vector \begin{pmatrix} -1 \\ 3 \end{pmatrix} is:

R = \begin{pmatrix} 4/5 & 3/5 \\ 3/5 & 1/5 \end{pmatrix}

